import React, { useState } from 'react';
import './Navbar.css';
import { Link, useNavigate } from 'react-router-dom';


const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleNavbar = () => {
    setIsOpen(!isOpen);
  };

  const auth = localStorage.getItem('user');
  const navigate = useNavigate();

  const logout = () => {
    localStorage.clear();
    navigate('/signup')
  }

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="brand">Logo</div>
        <div className={`menu ${isOpen ? 'open' : ''}`}>
          <ul>
              {auth ? 
                <>
                <li className="nav-item"><Link to="/" className="nav-link">Products</Link></li>
                <li className="nav-item"><Link to="/add" className="nav-link">Add Products</Link></li>
                <li className="nav-item"><Link to="/update" className="nav-link">Update Products</Link></li>
                <li className="nav-item"><Link to="/profile" className="nav-link">Profile</Link></li>
                <li><Link onClick={logout} to="/signup" className="nav-link">Logout</Link></li>
                <h1>{localStorage.getItem("user")}</h1>
                </>
                  :
                <>
                <li><Link to="/signup" className="nav-link">Signup</Link></li>
                <li className="nav-item"><Link to="/login" className="nav-link">Login</Link></li>
               </>
              }
          </ul>
        </div>
        <button className={`toggle-button ${isOpen ? 'open' : ''}`} onClick={toggleNavbar}>
          <span className="bar"></span>
          <span className="bar"></span>
          <span className="bar"></span>
        </button>
      </div>
    </nav>
  );
};

export default Navbar;




